import movieReducer from "./movieReducer";
import isLoggedReducer from "./isLogged";
import { combineReducers } from "redux";

const rootReducers = combineReducers({
        movies: movieReducer,
        isLoged: isLoggedReducer 
    });
 export default rootReducers;
